import React from 'react';
import Navbar from '../../components/Navbar';
import { Link } from 'react-router-dom';
import landing from '../../assets/landing.jpg'; // Certifique-se de que o caminho da imagem esteja correto
import styles from './Landing.module.css';

function Landing() {
  return (
    <div>
      {/* Navbar */}
      <Navbar active="home" />
      
      {/* Wrapper principal */}
      <div className={styles.landing__wrapper}>
        
        {/* Texto da página */}
        <div className={styles.landing__text}>
          <h1>
            Schedule Your Daily Tasks With <span className="primaryText">DoDo!</span>
          </h1>
          <div className="btnWrapper">
            <Link to="/register" className="primaryBtn">Register</Link>
            <Link to="/login" className="secondaryBtn">Login</Link>
          </div>
        </div>
        
        {/* Imagem da página */}
        <div className={styles.landing__img}>
          <img src={landing} alt="landing" />
        </div>
        
      </div>
    </div>
  );
}

export default Landing;
